CREATE TABLE INSTRUTOR_TURMA(
   CPF_INSTRUTOR VARCHAR(14) NOT NULL
  ,ANO           INTEGER  NOT NULL
  ,NUMERO_TURMA  VARCHAR(2) NOT NULL
  ,TITULO_CURSO  VARCHAR(135) NOT NULL
  ,FOREIGN KEY (CPF_INSTRUTOR) REFERENCES INSTRUTOR(CPF_INSTRUTOR)
  ,FOREIGN KEY (ANO) REFERENCES TURMA(ANO)
  ,FOREIGN KEY (NUMERO_TURMA) REFERENCES TURMA(NUMERO_TURMA)
  ,FOREIGN KEY (TITULO_CURSO) REFERENCES TURMA(TITULO_CURSO)
  ,PRIMARY KEY(CPF_INSTRUTOR,ANO,NUMERO_TURMA,TITULO_CURSO)
);
